import logo from './logo.svg';
import './App.css';
import React from 'react';
import './styles.css';
import {useState} from 'react';

const App=()=>{
    const [users,setUsers]=useState([]);
  const loadUsers=async()=>{
    console.log('before ');
    const response=await fetch("https://api.github.com/users");
    const jsonresponse=await response.json();
    setUsers(jsonresponse);
  };
    return(
 <div className="App">
   <h1>hello all</h1>
   <button onClick={loadUsers}>Get Data</button>
   <h2>USERS:</h2>
   <ul>

     {users.map(( { id, login,url,html_url,followers_url,following_url,gists_url,starred_url,subscriptions_url,type,site_admin,organizations_url,repos_url,received_events_url,events_url}) =>(
     <div><li key={id}>id:{id} </li>
     <li>Name: {login}
     url:{url}
     html_url:{html_url}
     followers_url:{followers_url}
     following_url:{following_url}
     gists_url:{gists_url}
     starred_url:{starred_url}
     subscriptions_url:{subscriptions_url}
     type:{type}
     site_admin:{site_admin}
     organizations_url:{organizations_url}
     repos_url:{repos_url}
     received_events_url:{received_events_url}
     events_url:{events_url}
     </li>

     </div>
       ))}

 </ul>
   </div>

   );
 }
 export default App;
